import React from 'react';
import styled from 'styled-components';
import { BlotterText } from './BlotterText';

const TokenSection = styled.section`
  min-height: 100vh;
  width: 100%;
  padding: 4rem 2rem;
  background: var(--background);
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const SectionTitle = styled.div`
  text-align: center;
  margin-bottom: 4rem;
`;

const ContentContainer = styled.div`
  max-width: 1200px;
  width: 100%;
  margin: 0 auto;
  display: grid;
  grid-template-columns: 1fr 1fr;
  gap: 4rem;
  align-items: center;

  @media (max-width: 768px) {
    grid-template-columns: 1fr;
    gap: 2rem;
  }
`;

const Description = styled.div`
  color: rgba(255, 255, 255, 0.9);
  font-size: 1.2rem;
  line-height: 1.6;
  margin-bottom: 2rem;
`;

const TokenomicsContainer = styled.div`
  background: rgba(255, 255, 255, 0.05);
  border-radius: 12px;
  padding: 2rem;
`;

const TokenomicsTitle = styled.div`
  margin-bottom: 2rem;
  text-align: center;
`;

const TokenomicsList = styled.ul`
  list-style: none;
  padding: 0;
  margin: 0;
`;

const TokenomicsItem = styled.li`
  display: flex;
  justify-content: space-between;
  padding: 1rem 0;
  border-bottom: 1px solid rgba(255, 255, 255, 0.1);
  color: rgba(255, 255, 255, 0.8);

  &:last-child {
    border-bottom: none;
  }
`;

const PerksContainer = styled.div`
  margin-top: 3rem;
`;

const PerksList = styled.ul`
  list-style: none;
  padding: 0;
  margin: 0;
`;

const PerkItem = styled.li`
  color: rgba(255, 255, 255, 0.8);
  padding: 0.5rem 0;
  display: flex;
  align-items: center;

  &::before {
    content: 'ðŸ”¥';
    margin-right: 1rem;
  }
`;

const BuyButton = styled.a`
  padding: 1rem 2rem;
  font-size: 1.2rem;
  border: 2px solid var(--accent);
  border-radius: 8px;
  color: var(--accent);
  text-decoration: none;
  transition: all 0.3s ease;
  display: inline-block;
  margin-top: 2rem;

  &:hover {
    background: var(--accent);
    color: var(--background);
    transform: translateY(-2px);
  }
`;

const tokenomics = [
  { label: "Total Supply", value: "1,000,000,000,000" },
  { label: "Initial Liquidity", value: "80%" },
  { label: "Marketing", value: "10%" },
  { label: "Development", value: "10%" }
];

const perks = [
  "Extra AI queries with Squanchy",
  "Early access to new Squanchiverse content",
  "Exclusive giveaways and events",
  "Special Discord roles and privileges"
];

export const Token: React.FC = () => {
  return (
    <TokenSection id="token">
      <SectionTitle>
        <BlotterText 
          text="Get Squanchy with $SQUANCH!"
          fill="rgba(255, 255, 255, 0.9)"
        />
      </SectionTitle>

      <ContentContainer>
        <div>
          <Description>
            The official currency of the Squanchiverse. Meme your way to the moon, powered by AI and quantum chaos.
          </Description>

          <TokenomicsContainer>
            <TokenomicsTitle>
              <BlotterText 
                text="Tokenomics"
                fill="rgba(255, 255, 255, 0.9)"
              />
            </TokenomicsTitle>
            <TokenomicsList>
              {tokenomics.map((item, index) => (
                <TokenomicsItem key={index}>
                  <span>{item.label}</span>
                  <span>{item.value}</span>
                </TokenomicsItem>
              ))}
            </TokenomicsList>
          </TokenomicsContainer>

          <BuyButton href="#buy">Buy $SQUANCH Now</BuyButton>
        </div>

        <PerksContainer>
          <TokenomicsTitle>
            <BlotterText 
              text="Holder Perks"
              fill="rgba(255, 255, 255, 0.9)"
            />
          </TokenomicsTitle>
          <PerksList>
            {perks.map((perk, index) => (
              <PerkItem key={index}>{perk}</PerkItem>
            ))}
          </PerksList>
        </PerksContainer>
      </ContentContainer>
    </TokenSection>
  );
};
